import {
  STORE_DATA,
  SEARCH_DATA,
  ADD_CART,
  DELETE_CART,
  REMOVE_ALL,
} from "./ActionTypes/actiontype";
const StoreData = (payload) => ({
  type: STORE_DATA,
  payload: payload,
});

export const searchData = (payload) => ({
  type: SEARCH_DATA,
  payload: payload,
});
export const AddCart = (payload) => ({
  type: ADD_CART,
  payload: payload,
});
export const DeleteCart = (payload) => ({
  type: DELETE_CART,
  payload: payload,
});
export const RemoveAllcart = () => ({
  type: REMOVE_ALL,
});

export default StoreData;
